import MainGrid from "components/shared/MainGrid";
import Fade from "react-reveal/Fade";

function Title({children}) {
  return (
      <MainGrid>
        <TitlePlaced>
          <Fade>
          {children}



          </Fade>
        </TitlePlaced>
      </MainGrid>
  );
}

export default Title;

const TitlePlaced = styled.div`
  grid-column: 2 / span 11;
`;
